# Definition for an interval.# class Interval:#     def __init__(self, s=0, e=0):#         self.start = s#         self.end = eclass Solution:    def merge(self, intervals):        """        :type intervals: List[Interval]        :rtype: List[Interval]        """        n=len(intervals)        if n==0:            return []        res=[]        intervals.sort(key=lambda x: (x.start,x.end))        res.append(intervals[0])        for i in range(1,n,1):            if intervals[i].start>res[-1].end:                res.append(intervals[i])            else:                res[-1].end=max(res[-1].end,intervals[i].end)        return res